import styled from "styled-components";
import Link from "next/link";

function Navigation() {
  return (
    <StyledNavigation>
      <Heading>
        <Link href="/">
          <a>Catalogue it</a>
        </Link>
      </Heading>
      <div>
        <NavLinks>
          <li>
            <Link href="/feed">
              <a>Feed</a>
            </Link>
          </li>
          <li>
            <Link href="/profile">
              <a>Profile</a>
            </Link>
          </li>
          <li>
            <Link href="/settings">
              <a>Settings</a>
            </Link>
          </li>
          <li>
            <Link href="/">
              <a>Logout</a>
            </Link>
          </li>
        </NavLinks>
      </div>
    </StyledNavigation>
  );
}

const StyledNavigation = styled.nav`
  display: flex;
  justify-content: space-between;
`;

const Heading = styled.h1`
  text-transform: uppercase;
  font-size: 3.6rem;
  color: #393939;

  a {
    text-decoration: none;
    color: #393939;
  }
`;

const NavLinks = styled.ul`
  display: flex;
`;

export default Navigation;
